Description
. 
Female
(AMS KS.10530): Cephalic area slightly elevated with a pair of whitish setae on the MOQ (
Fig. 16B
); anterior eyes arranged in a strongly recurved row and posterior ones in a straight row; PLE preceded by a pair of clavate setae. Clypeal area and chelicerae striped; prosoma and legs orange with reddish-brown stripes and sparse spots; tibiae I bear five pairs of ventral macrosetae (
Fig. 16A
). Opisthosoma obovate, with anterior border slightly concave, yellowish with median light-brown bands weakly delimited by darker ones on both sides (
Fig. 16A
). Spermathecae elongated, with glandular-heads directed laterally (
Fig. 16D
).

Male
(AMS KS.128377): Eye pattern and cephalic area as in female; prosoma light-orange with darker stripes on its median portion and sides (
Fig. 17A and B
); opisthosoma and legs predominantly yellow and covered by claviate setae, except by the tibiae, metatarsi and tarsi of the leg I, which are dark-orange and bear long filiform barbs (
Fig. 17A
). Palpi with rounded tegulum, long and flattened embolus resting on a retro lateral membranous region of the tegular ridge; Pcym discrete and hyaline (
Fig. 17C
). Other somatic features as in female.
